import React, {useState} from 'react';

const FnErrorBtn = () => {
    const [st, setSt] = useState({
        point: null
    })
    const akeError = () => {
        setSt(pr=>{
            return {
                ...pr,
                point: pr.sdsd
            }
        })
    }
    return (
        <>
            <span>{st}</span>
            <button onClick={akeError}>ERROR</button>
        </>
    );
};

export default FnErrorBtn;
